import React from 'react';
import { useNavigate } from 'react-router-dom';

const MangeAccount = () => {

    const navigate = useNavigate();

    return (
        <div className='manageContainer' onClick={() => navigate('../')}>
            <h1>MangeAccount</h1>
        </div>
    );
}

export default MangeAccount;
